            padding: 10px;
            width: 330px;
            background: linear-gradient(-45deg, #6B9AD4, #7289DA, #877CDA, #DA729F, #F5C8E3);
            background-size: 400% 400%;
            animation: gradient 15s ease infinite;
            z-index: 0;
            border-radius: 10px;
        }
        
        .footer a{
            color: #ffffff;
        }

        .joinButton {

            border: 2px solid white;
            color: white;
            padding: 15px 32px;
            text-align: center;
            text-decoration: none;
            display: inline-block;
            font-size: 16px;
            margin: 4px 2px;
            cursor: pointer;
            min-width: 180px;
            min-height: 20px;
            border-radius: 10px;
        }
        .playingContainer{
            padding:15px 32px;
            display: flex;
            align-items: center;
            justify-content: center;
            margin-top: 10px;
            background: linear-gradient(-45deg, #6B9AD4, #7289DA, #877CDA, #DA729F, #F5C8E3);
            border-radius: 10px;
            width: 290px;
            justify-content: center;
            margin: auto;
            animation: gradient 15s ease infinite;
            background-size: 400% 400%;
            margin-top: 15px;
        }
        .footer{
            margin-top: 15px;
            font-size: 0.8rem;
            background: linear-gradient(-45deg, #6B9AD4, #7289DA, #877CDA, #DA729F, #F5C8E3);
            animation: gradient 15s ease infinite;
            background-size: 400% 400%;
            width:330px;
            border-radius: 10px;
            margin: auto;
            padding: 10px;
            margin-top: 15px;
        }

        .valheimLogo {
            height:74px;
            margin-left:30px;
            -webkit-filter: drop-shadow(1px 1px 1px rgb(rgb(184, 183, 183)));
            filter: drop-shadow(1px 1px 1px rgb(184, 183, 183));
            mix-blend-mode: luminosity;
        }

        a.mailto:hover{
            transform: scale(1.05) translate(2px, 0px);
            transition: 0.5s;
        }

        a.mailto{
            display: inline-block;
            height:10px;
            text-decoration: none;
            font-weight: bold;

        }

        @keyframes gradient {
            0% {
                background-position: 0% 50%;
            }

            50% {
                background-position: 100% 50%;
            }

            100% {
                background-position: 0% 50%;
            }
        }

        .joinButton:hover {
            background-color: #6f61e9;
            mix-blend-mode: luminosity;
            transform: scale(1.05);
            transition: 0.5s;


        }

        .logo{
            -webkit-filter: drop-shadow(1px 1px 1px rgb(rgb(184, 183, 183)));
            filter: drop-shadow(1px 1px 1px rgb(184, 183, 183));
        }

        .arkLogo{
            height: 80px;
            -webkit-filter: drop-shadow(1px 1px 1px rgb(rgb(184, 183, 183)));
            filter: drop-shadow(1px 1px 1px rgb(184, 183, 183));
            mix-blend-mode: luminosity;
        }

        .ow2Logo{
            
            height:70px;
            -webkit-filter: drop-shadow(1px 1px 1px rgb(rgb(184, 183, 183)));
            filter: drop-shadow(1px 1px 1px rgb(184, 183, 183));
            mix-blend-mode: luminosity;
        }

        h2{
            font-size: 1rem
        }

        .ow2Logo:hover, .arkLogo:hover, .valheimLogo:hover{
            -webkit-filter: drop-shadow(1px 1px 1px rgb(rgb(184, 183, 183)));
            filter: drop-shadow(1px 1px 1px rgb(184, 183, 183));
            transform: scale(1.1);
            transition: 0.5s;
            mix-blend-mode: normal;
        }


    </style>
</head>
